import ReactDOM from "react-dom/client"; // Import ReactDOM
import { useState } from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Layout from "./pages/Layout";
import Home from "./pages/Home";
import Update from "./pages/Update";
import NoPage from "./pages/NoPage";
import Login from "./pages/Login";
import Register from "./pages/Register";
import './style.css';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogout = () => {
    setIsLoggedIn(false);
  };

  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout setIsLoggedIn={setIsLoggedIn} handleLogout={handleLogout} />}>
          <Route index element={isLoggedIn ? <Home /> : <Login setIsLoggedIn={setIsLoggedIn} />} />
          <Route path="update" element={isLoggedIn ? <Update /> : <Login setIsLoggedIn={setIsLoggedIn} />} />
          <Route path="*" element={<NoPage />} />
        </Route>
        <Route path="/login" element={<Login setIsLoggedIn={setIsLoggedIn} />} />
        <Route path="/register" element={<Register />} />
      </Routes>
    </BrowserRouter>
  );
}

// Render the app into the root element of your HTML
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);
